import React, { useEffect } from "react";
import { useForm } from "react-hook-form";
import { useParams, useRouteMatch } from "react-router-dom";
import {
  AddItemDesc,
  SingleProductContainerWrapper,
} from "../../styled-component/Container.styled";
import { ProductDetailWrapper } from "../../styled-component/Flex.styled";
import {
  InputField,
  SelectOptions,
  TextAreaStyled,
} from "../../styled-component/Input.styled";
import {
  DescriptionWrapper,
  Productname,
} from "../../styled-component/Typography.styled";

function ProductCreateComponent() {
  const {
    handleSubmit,
    formState: { errors },
  } = useForm();

  useEffect(() => {}, []);

  const submitHnadler = (data) => {};

  const errorHandler = (err) => {};
  return (
    <SingleProductContainerWrapper>
      <ProductDetailWrapper>
        <AddItemDesc>
          <Productname alignText="center" marginLeft="2px">
            {" "}
            Description
          </Productname>

          <div>
            <form onSubmit={handleSubmit(submitHnadler, errorHandler)}>
              <InputField
                type="text"
                id="prod-name"
                placeholder="Product Name"
              ></InputField>
              <TextAreaStyled
                rows="4"
                id="description"
                placeholder="Description"
              ></TextAreaStyled>
              <InputField
                type="text"
                id="img-url"
                placeholder="Image URL"
              ></InputField>
              <InputField
                type="text"
                id="price"
                placeholder="Price"
              ></InputField>
              <SelectOptions name="cars" id="cars">
                <option value="volvo">Volvo</option>
                <option value="saab">Saab</option>
                <option value="mercedes">Mercedes</option>
                <option value="audi">Audi</option>
              </SelectOptions>
            </form>
          </div>
        </AddItemDesc>
      </ProductDetailWrapper>
    </SingleProductContainerWrapper>
  );
}

export default ProductCreateComponent;
